import { RetryLink } from "@apollo/cliemt/link/retry";
const link = new RetryLink( {
attempts: 再送信の条件を設定,
delay: ( attempt, operation, error ) => {
return 500; //リクエスト再送信間隔は常に0.5秒
}
} );

import { RetryLink } from "@apollo/cliemt/link/retry";
const link = new RetryLink( {
attempts: 再送信の条件を設定,
delay: ( attempt, operation, error ) => {
const operationName = operation.operationName;
if (operationName === "longProcess") {
return 2000; //時間のかかるクエリ (操作名:longProcess) の再送信間隔は2秒
} else if (operationName === "quickProcess") {
return 1000; //時間のかからないクエリ (操作名:quickProcess) の再送信間隔は1秒
} else {
return 1500 * attempt; //それ以外のクエリの再送信間隔は1.5秒 (指数バックオフ)
}
}
} );
